const styles = {
    button: {
        backgroundColor: '#ff007f',
        height: 60,
        flexDirection: 'row',
        borderRadius: 50,
        overflow: 'hidden',
        alignItems: 'center',
        marginTop: 8,
    },

    buttonIcon: {
        height: 60,
        width: 60,
        backgroundColor: 'rgba(0, 0, 0, 0.1)',
        justifyContent: 'center',
        alignItems: 'center'
    },

    buttonReturn: {
        backgroundColor: '#add8e6',
        height: 60,
        flexDirection: 'row',
        borderRadius: 50,
        overflow: 'hidden',
        alignItems: 'center',
        marginTop: 8,
    },

    buttonText: {
        flex: 1,
        justifyContent: 'center',
        textAlign: 'center',
        color: '#FFF',
        fontFamily: 'Roboto_500Medium',
        fontSize: 16,
    },

    container: {
        flex: 1,
        padding: 32,
        backgroundColor: '#F0F0F5'
    },
    
    description: {
        height: 180,
        backgroundColor: '#FFF',
        borderRadius: 10,
        marginBottom: 80,
        paddingHorizontal: 10,
        paddingVertical: 10,
        fontSize: 16,
    },

    footer: {},

    image: {
        width: 200,
        height: 200,
        alignItems: 'center',
        borderRadius: 100,
        marginTop: 50
    },

    input: {
        height: 60,
        backgroundColor: '#FFF',
        borderRadius: 10,
        marginBottom: 8,
        paddingHorizontal: 24,
        fontSize: 16,
    },

    main: {
        flex: 1,
        alignItems: 'center'
    },

    main2: {
        flex: 1,
        alignItems: 'center'
    },

    select: {},

    title: {
        fontFamily: 'Ubuntu_700Bold',
        color: '#322153',
        fontSize: 17,
        marginTop: 115,
        textAlign: 'center'
    },
}

export default styles;
